import React, { useState } from "react";
import Card from "./UI/Card";
const Example = () => {
  const [value, setValue] = useState("umair");
  const valueHandler = () => {
    setValue("umairGhaffar");
  };
  return (
    <Card>
      <h1>{value}</h1>
      <button onClick={valueHandler}>Change</button>
    </Card>
  );
};

export default Example;
